  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Mason Neck and Featherstone National Wildlife
  Refuges for the next 15 years. This plan outlines the Refuge vision and purpose
  and describes how the Refuges will contribute to the overall mission of the Refuge
  System. The plan provides an introduction to the Refuges, an overview of the CCP
  planning process, information about the environment, information about the management
  direction, and strategies for implementation.\",\n\t\"license_title\": \"License
